import axiosClient from "./axiosClient";

const EmployeeApi  = {
    getAll : (params) => {
    const url = '/employees';
    return axiosClient.get(url, { params });
    },
    getdelete : (id,params) => {
        const url = '/employees/'+id;
        return axiosClient.delete(url, { params });
        }
    }
    export default EmployeeApi;
